import React, { useState } from "react";
import "./Login.css"

export default function Login(props) {

    const [formValues, setFormValues] = useState({
        username: "",
        password: ""
    });

    const handleChange = (event) => {
        const { name, value } = event.target
        setFormValues({ ...formValues, [name]: value })
    }

    const fetchUser = (event) => {
        event.preventDefault();
        console.log(formValues);
    }

    return (
        <div class="container">
            <div class="row">
                <div class="span4 offset4 well">
                    <legend>Please Sign In</legend>
                    <div class="alert alert-error">
                        Incorrect Username or Password!
                    </div>
                    <form onClick = {fetchUser}>
                        <input type="text" id="username" value ={formValues.username} onChange = {handleChange} class="span4" name="username" placeholder="Username" />
                        <input type="password" id="password" value= {formValues.password} onChange = {handleChange} class="span4" name="password" placeholder="Password"/>
                        <label class="checkbox">
                            <input type="checkbox" name="remember" value="1" /> Remember Me
                        </label>
                        <button type="submit" name="submit" class="btn btn-info btn-block ">Sign in</button>
                    </form>    
                </div>
            </div>
        </div>
    )

}
